{"variables":{},"query":"{
  getState {
    firstName
    lastName
    isVerified
    googleAnalyticsId
    loginState {
      token
      __typename
    }
    lolSettings {
      summoners {
        isDefault
        regionId
        riotTagLine
        riotUserName
        verified
        iconUrl
        iconId
        __typename
      }
      favoriteChampions {
        championId
        __typename
      }
      favoriteSummoners {
        regionId
        riotTagLine
        riotUserName
        iconUrl
        iconId
        __typename
      }
      __typename
    }
    filterDefaults {
      filterTierList {
        mmr
        queueType
        regionId
        role
        showAllChampions
        __typename
      }
      filterBuildsAndRunes {
        mmr
        queueType
        regionId
        __typename
      }
      __typename
    }
    premium {
      isPremium
      premiumVersion
      freeTrialAvailable
      isOnFreeTrial
      hasFailedPayment
      paymentFailureDate
      __typename
    }
    __typename
  }
}"}

